window.bookSummaryJSON = "<p>If it looks too easy, it probably is. The sequel to <i>WebMage</i> sends Ravirn and Melchior on a mission to Hell and back to rescue Cerice’s familiar and her dissertation. <i>CyberMancy</i> also sees Ravirn learning what it means to be the Raven and coping with his new status among the descendants of the Titan’s as he interacts with old \"friends\" like the Furies and meets new ones like Hades and Persephone.</p>"; 
